export default (function(a,b,c,d,e,f){return {data:{ExKkHIa0FO:{data:{id:2775,attributes:{imdbId:"tt9701942",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BN2YxZGFmNDMtNzlhYy00OTJlLTgzMDctZGNjNTMyNjAxYjM4XkEyXkFqcGdeQXVyMDM2NDM2MQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.6\u002F10"},{Source:"Rotten Tomatoes",Value:"90%"},{Source:"Metacritic",Value:"68\u002F100"}],item_lang:{data:{id:3442,attributes:{title:"Fear Street: Part Three - 1666",plot:"1666. An unspeakable evil has cast its unholy shadow over Union, the original settlement before its division into Sunnyvale and Shadyside, ushering in a new era of misfortune and terror. In the aftermath of the brutal mall killings in Fear Street: 1994 (2021), Deena finds herself plagued by vivid, blood-curdling visions of death and decay, forcing Cindy Berman, the only one who saw the sorceress and survived, after the bloody Camp Nightwing massacre in Fear Street: 1978 (2021), to step in. Now, there is no turning back, and until body and hand unite, no one is safe from the fiery curse of damned Sarah Fier. But evil has no boundaries. What will it take to rid Shadyside of the witch's sin?",slug:"fear-street-part-three-1666"}}},books:{data:[{id:13186,attributes:{title:"Fear Street The Beginning",description:"The classic and heart-pounding Fear Street Series from beloved author R.L. Stine is back with the first four books now in one thrilling package! Welcome to Fear Street… Where strange things happen, people go missing, and nightmares come true. This is where it all began. When Fear Street became legend, forever linked with danger, and curses, and things that go bump in the night. Go back to how it all started—to the moment when Corey Brooks falls for perfect, incredible Anna, only to learn that she’s gone missing...on Fear Street. Venture into the terrifying Fear Street woods where Meg Dalton’s best friend Evan died under mysterious circumstances, and discover why only Meg can uncover the truth behind his death. Follow Della to Fear Island and learn about the terrifying threats that force Della to confront her past—and the incident that occurred on the island between her and a dangerous stranger. Return to Fear Street with Mark and Cara Burroughs who come home to find that their parents have disappeared, plunging them into a nightmare of chaos that neither of them could have ever predicted. The only thing they know for sure is that though Fear Street may be a mystery, not everyone escapes such an evil place alive. Only danger awaits those brave enough to travel down Fear Street. You’re not afraid…are you?",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=J1wJEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2020-09-01",publisher:e,subtitle:"The New Girl; The Surprise Party; The Overnight; Missing"}},{id:13187,attributes:{title:"The Betrayal",description:"Nora knows the secrets behind the horrifying things happening on Fear Street and reveals the dark legacy that marked the start of the terror three hundred years earlier, when a young girl was burned at the stake.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=r5B2-wF-914C&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:b,published:"1993-08-01",publisher:e,subtitle:c}},{id:13188,attributes:{title:"The First Horror",description:"Fearing the tales surrounding Fear Street, twins Cally and Kody Frasier reluctantly move into the house their family has just bought, unaware that a evil secret haunts their new residence and threatens to claim them before it is discovered. Original.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=yRedko-52qMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"1994-08-01",publisher:d,subtitle:c}},{id:13189,attributes:{title:"The New Girl",description:"FEAR STREET -- WHERE YOUR WORST NIGHTMARES LIVE... The new girl is as pale as a ghost, blond, and eerily beautiful -- and she seems to need him as much as he wants her. Cory Brooks hungers for Anna Corwin's kisses, drowns in her light blue eyes. He can't get her out of his mind. He has been loosing sleep, ditching his friends...and everyone has noticed. Then as suddenly as she came to Shadyside High, Anna disappears. To find a cure for his obsession, Cory must go to Anna's house on Fear Street -- no matter what the consequences. Anna may be the love of his life...but finding out her secret might mean his death.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=wob5dX6t4R4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:f,publisher:d,subtitle:c}},{id:13190,attributes:{title:"The Burning",description:"Daniel and Nora, two young lovers from feuding families, must use their forbidden love to stop the awesome evil that stalks Nora and her family.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=9Z4-1tBikCoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:f,publisher:d,subtitle:c}}]}}},meta:{}}},prerenderedAt:1680940900168}}("R.L. Stine",false,"","Simon and Schuster","Simon Pulse","2008-06-30"))